public class Solution1TLE {
    public int canCompleteCircuit(int[] gas, int[] cost) {
        for(int i=0;i<gas.length;i++) {
            if(gas[i] < cost[i]) {
                continue;
            }
            int currentGas = gas[i];
            int j = i;
            while(currentGas>=cost[j]) {
                int nextVal = (j+1)%gas.length;
                currentGas+=(gas[nextVal]-cost[j]);
                 j = nextVal;
                if(j==i){
                    return i;
                }
            }
            if(j!=i) {
                continue;
            }
        }
        return -1;
    }
}

